import React, { useEffect } from 'react';
import { Nav, NavLink, Bars, NavMenu, NavBtn } from './NavbarElements';

const Navbar = () => {
    useEffect(() => {
        WebFont.load({
          google: {
            families: ['Poppins', 'Roboto']
          }
        });
       }, []);

    return (
    <>
        <Nav>
            <NavLink to="/">
                <h1>ASdf</h1>
            </NavLink>
            <Bars />
            <NavMenu>
                <NavLink to="/" activestyle="true">
                    Home
                </NavLink>
                <NavLink to="/" activestyle="true">
                    Services
                </NavLink>
                <NavLink to="/" activestyle="true">
                    Contact
                </NavLink>
                <NavLink to="/" activestyle="true">
                    Signup
                </NavLink>
            </NavMenu>
            <NavBtn></NavBtn>
        </Nav>
    </>
    );
};

export default Navbar
